import React from 'react';
import './Footer.css';

function Footer() {
  return (
    <div className='footer-container'>
      <section className='footer-subscription'>
        <p className='footer-subscription-heading'>
          वरद फार्म हाऊस
        </p>
        <p className='footer-subscription-text'>
          केर्ले - (आंबा), ता. शाहूवाडी, जि. कोल्हापूर.
        </p>
        <p className='footer-subscription-text'>
          Contact Us -  8766548084, 7875642124,  9370816863, 8928706138
        </p>
        <p className='footer-subscription-text'>
        All Rights Reserved By The Jungle Resort Amba
        </p>
      </section>
    </div>
  );
}

export default Footer;
